import React from 'react';
import ReactDom from 'react-dom';
import Tile from './Tile'


const ChemData = require('periodic-table');
var chemArray = [];
var actLan = [];
var actL = 56;
var atomicNum = 0;
function addArray(){
    for(let x = 0; x < 209; x++){
        if((x > 1 && x < 18) || (x>20 && x < 31)|| (x>38 && x < 49)){
            chemArray[x-1] = [{name:'blank'}]; 
        }else if(atomicNum > 56 && atomicNum < 103){
            actLan[actL] = chemArray[atomicNum]
            actL++;
            atomicNum++
        }
        else{
            if(atomicNum < 119){
                chemArray[x-1] = ChemData.numbers[atomicNum]; 
                atomicNum++;
            }else{
                chemArray[x-1] = []; 
            }
        }
    }
}

function addTile(data)
{   
    
    console.log(data.name);
    
    
    return <Tile 
        name = {data.symbol}
    />
}

function TableHolder(){
    return <div className='PTable'>
        {addArray(), chemArray.map(addTile)}
        
    </div>
}

export default TableHolder;
